import React from 'react';
import { Link } from 'react-router-dom';
import { MdPlace } from 'react-icons/md';
import {
  PostCard,
  PostCommentCard,
  PostCommentHeader,
  PostContentWrapper,
  PostHeader,
  PostImg,
  PostTitle,
  UserImg,
  UserName,
} from './PostStyle';
import profile from '../../assets/img/profile.jpg';

const Post: React.FC = () => {
  return (
    <>
      <PostCard>
        <PostHeader>
          <UserImg src={profile} />
          <Link to="/mypage" style={{ textDecoration: 'none' }}>
            <UserName>차승민</UserName>
          </Link>
        </PostHeader>
        <PostImg src={profile} />
      </PostCard>
      <PostCommentCard>
        <PostCommentHeader>
          <Link to="/mypage" style={{ textDecoration: 'none' }}>
            <UserName>차승민</UserName>
          </Link>
          <PostTitle>갈대밭 노을</PostTitle>
        </PostCommentHeader>
        <PostContentWrapper>
          <MdPlace size="20" />
        </PostContentWrapper>
      </PostCommentCard>
    </>
  );
};

export default Post;
